    fetch("/users")
    .then(res => res.json())
    .then(data => {
      setData(data)
      console.log(data)
    }
    )
  }, [])

  mappedUsers = data.map((users)=> users.first_name)

  return (
    <div className="App">
      <header className="App-header">

      </header>
      <div>
        <h3>Page content</h3>
      </div>
      <footer>
        <p>client side ready to use</p>
      </footer>
    </div>
  );
}

export default App;
